	 ('<p><img src="http://localhost:8080/bookie/images/question/921ff50c-1107-44cd-8737-818b2dfd01a0_image.png" alt="문제이미지" contenteditable="false"><br></p>',4,'<p><img src="http://localhost:8080/bookie/images/comment/0c088657-0cb0-4184-87ef-0889344a5f14_image.png" alt="문제이미지" contenteditable="false"></p><p><img src="http://localhost:8080/bookie/images/comment/4533e0cf-8770-4218-9eef-d1dac7d2d63e_image.png" alt="문제이미지" contenteditable="false"></p>',146,NULL,18,'2022-08-22 15:36:55.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/8df6b97c-06cb-4457-b020-7c67ed125beb_image.png" alt="문제이미지" contenteditable="false"><br></p>',2,'<p><img src="http://localhost:8080/bookie/images/comment/d0fb36df-6c42-4ca0-a061-1e83d390a471_image.png" alt="문제이미지" contenteditable="false"></p>',147,NULL,18,'2022-08-22 15:37:42.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/b4cbd4d3-01c4-4e11-a791-6115fc623865_image.png" alt="문제이미지" contenteditable="false"><br></p>',3,'<p><img src="http://localhost:8080/bookie/images/comment/650b9a41-6c82-4dcb-bdc5-c8b03327f472_image.png" alt="문제이미지" contenteditable="false"></p>',148,NULL,18,'2022-08-22 15:37:55.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/03ebb360-1f89-4590-821f-cb9d26e4af90_image.png" alt="문제이미지" contenteditable="false"></p>',4,'<p>&lt;출전&gt; 가설 검정과 오류(재구성)</p><p>개관 : 이 글은 가설 검정과 판단 과정에서 발생할 수 있는 두 가지 오류에 대해 설명하고 있다. 가설 검정은 통계적 자료를 통해 확률에 근거한 판단을 내리는 절차이므로, 오류가 발생할 수 있다. 1종 오류는 귀무가설이 실제 참인데도 불구하고 이를 기각하는 오류를 뜻한다. 반대로 2종 오류는 귀무가설이 틀렸음에도 이를 기각하지 못하는 오류를 뜻한다. 1종 오류가 2종 오류에 비해 더 심각한 결과를 가지고 오므로 가설 검정에서는 유의 수준을 두어 1종 오류를 범할 확률의 최대 허용 범위를 최소화하는데 중점을 둔다.</p><p>{출제의도}</p><p>세부 내용 추론하기</p><p>2문단과 3문단에 따라 &lt;보기&gt;의 표를 정리하면, A와 D는 실제 상황에 맞는 판단을 한 것이다. 이에 비해 B는 귀무가설이 거짓임에도 기각하지 못한 것이므로 2종 오류를, C는 귀무가설이 참임에도 기각한 것이므로 1종 오류를 범한 것이다. 판결에서 2종 오류를 줄이면 1종 오류가 늘어난다. 3문단에 따르면 판결에서 1종 오류란 ‘무죄인 사람에게 유죄를 선고하는 것’이므로, 1종 오류가 는다는 것은 무죄인 사람에게 유죄 판결을 내리는 경우가 는다는 것을 의미한다.</p><p>{오답풀이}</p><p>① A와 C는 모두 귀무가설이 참인 상황에 해당한다. 판결에서 귀무가설은 ‘피고인이 무죄이다.’이므로 피고인이 죄를 저지르지 않은 것에 해당한다.</p><p>② A와 B는 모두 귀무가설을 기각하지 못한 판단에 해당한다. 약효 실험에서 귀무가설은 ‘신약이 효과가 없다.’이다.</p><p>③ A와 D는 실제 상황에 맞는 판단이므로 오류가 발생하지 않은 것에 해당한다.</p><p>⑤ C는 1종 오류에 해당한다. 4문단에 따르면, 제약 회사의 1종 오류란 신약의 효능이 없어 회사가 신뢰를 잃는 것이다.</p>',149,19,16,'2022-08-22 15:38:01.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/3650406f-7758-4509-88fb-1262132ea93f_image.png" alt="문제이미지" contenteditable="false"></p>',1,'<p>&lt;출전&gt; 가설 검정과 오류(재구성)</p><p>개관 : 이 글은 가설 검정과 판단 과정에서 발생할 수 있는 두 가지 오류에 대해 설명하고 있다. 가설 검정은 통계적 자료를 통해 확률에 근거한 판단을 내리는 절차이므로, 오류가 발생할 수 있다. 1종 오류는 귀무가설이 실제 참인데도 불구하고 이를 기각하는 오류를 뜻한다. 반대로 2종 오류는 귀무가설이 틀렸음에도 이를 기각하지 못하는 오류를 뜻한다. 1종 오류가 2종 오류에 비해 더 심각한 결과를 가지고 오므로 가설 검정에서는 유의 수준을 두어 1종 오류를 범할 확률의 최대 허용 범위를 최소화하는데 중점을 둔다.</p><p>{출제의도}</p><p>핵심 정보 파악하기</p><p>1문단에 따르면, 가설 검정을 위해 귀무가설과 대립가설을 설정한다고 하였다. 귀무가설을 기각하면 대립가설을 채택하게 될 뿐이므로, 귀무가설을 기각할 때 새롭게 가설을 설정하는 것은 아니다.</p><p>{오답풀이}</p><p>② 2문단에 따르면, 대립가설을 기준으로 가설 검정을 하는 것은 현실적으로 어려우므로 귀무가설을 기준으로 검정한다.</p><p>③ 2문단에 따르면, 대립가설의 채택 여부는 귀무가설을 중심으로 이루어진다.</p><p>④ 4문단에 따르면, 1종 오류와 2종 오류는 동시에 줄일 수 없다. 그 이유는 한쪽 오류를 줄이면 그만큼 반대쪽 오류는 늘어나기 때문이다.</p><p>⑤ 4문단에 따르면, 오류 중 상대적으로 더 심각한 결과를 초래하는 것은 1종 오류이다.</p>',149,19,16,'2022-08-22 15:38:01.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/4467ccdd-232d-4466-b906-9ddf6e196943_image.png" alt="문제이미지" contenteditable="false"></p>',5,'<p>&lt;출전&gt; 가설 검정과 오류(재구성)</p><p>개관 : 이 글은 가설 검정과 판단 과정에서 발생할 수 있는 두 가지 오류에 대해 설명하고 있다. 가설 검정은 통계적 자료를 통해 확률에 근거한 판단을 내리는 절차이므로, 오류가 발생할 수 있다. 1종 오류는 귀무가설이 실제 참인데도 불구하고 이를 기각하는 오류를 뜻한다. 반대로 2종 오류는 귀무가설이 틀렸음에도 이를 기각하지 못하는 오류를 뜻한다. 1종 오류가 2종 오류에 비해 더 심각한 결과를 가지고 오므로 가설 검정에서는 유의 수준을 두어 1종 오류를 범할 확률의 최대 허용 범위를 최소화하는데 중점을 둔다.</p><p>{출제의도}</p><p>세부 내용 파악하기</p><p>1문단에 따르면, 판단하는 이가 옳다고 주장하고 싶은 가설은 대립가설이다.</p><p>{오답풀이}</p><p>①, ③ 2문단에 따르면 귀무가설이 기각되면 대립가설은 채택된다.</p><p>② 3문단에 따르면 판결에서 가설의 기각 여부는 판사가 결정한다.</p><p>④ 2문단에 따르면 귀무가설은 참과 거짓을 알기 전까지는 참으로 간주한다.</p>',149,19,16,'2022-08-22 15:38:02.0');
INSERT INTO Question (qText,answer,qComment,qtId,mtId,cateId,regDate) VALUES
	 ('<p><img src="http://localhost:8080/bookie/images/question/09844092-a71e-44cb-adcc-0492adc7f84b_image.png" alt="문제이미지" contenteditable="false"></p>',3,'<p>&lt;출전&gt; 가설 검정과 오류(재구성)</p><p>개관 : 이 글은 가설 검정과 판단 과정에서 발생할 수 있는 두 가지 오류에 대해 설명하고 있다. 가설 검정은 통계적 자료를 통해 확률에 근거한 판단을 내리는 절차이므로, 오류가 발생할 수 있다. 1종 오류는 귀무가설이 실제 참인데도 불구하고 이를 기각하는 오류를 뜻한다. 반대로 2종 오류는 귀무가설이 틀렸음에도 이를 기각하지 못하는 오류를 뜻한다. 1종 오류가 2종 오류에 비해 더 심각한 결과를 가지고 오므로 가설 검정에서는 유의 수준을 두어 1종 오류를 범할 확률의 최대 허용 범위를 최소화하는데 중점을 둔다.</p><p>{출제의도}</p><p>핵심 개념 확인하기</p><p>유의 수준은 1종 오류가 발생할 확률의 최대 허용 범위이다. 이 범위 내에서는 1종 오류가 발생하더라도 대립가설을 채택한다. 따라서 유의 수준을 낮게 정할수록 대립가설을 채택할 확률은 낮아진다.</p><p>{오답풀이}</p><p>① 인권과 관련된 판단일수록 값을 작게 설정해야 한다.</p><p>② 유의 수준은 참일 확률과 거짓일 확률의 차이를 의미하는 것은 아니다.</p><p>④ 유의 수준은 실험 전에 미리 정하는 것이다.</p><p>⑤ 유의 수준은 1종 오류가 발생할 확률의 최대 허용 범위이다. 가설을 판단할 때 사용할 자료 개수의 최대 허용 범위와는 관련이 없다.</p>',149,19,16,'2022-08-22 15:38:03.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/43de65bc-b7bd-46ae-a813-677e77a54aa5_image.png" alt="문제이미지" contenteditable="false"></p>',4,'<p>&lt;출전&gt; 가설 검정과 오류(재구성)</p><p>개관 : 이 글은 가설 검정과 판단 과정에서 발생할 수 있는 두 가지 오류에 대해 설명하고 있다. 가설 검정은 통계적 자료를 통해 확률에 근거한 판단을 내리는 절차이므로, 오류가 발생할 수 있다. 1종 오류는 귀무가설이 실제 참인데도 불구하고 이를 기각하는 오류를 뜻한다. 반대로 2종 오류는 귀무가설이 틀렸음에도 이를 기각하지 못하는 오류를 뜻한다. 1종 오류가 2종 오류에 비해 더 심각한 결과를 가지고 오므로 가설 검정에서는 유의 수준을 두어 1종 오류를 범할 확률의 최대 허용 범위를 최소화하는데 중점을 둔다.</p><p>{출제의도}</p><p>문맥적 의미 파악하기</p><p>3문단에 따르면, ‘피고인은 유죄이다.’가 대립가설이라고 하였으므로 귀무가설은 ‘피고인은 무죄이다.’가 된다.</p><p>{오답풀이}</p><p>① 두 가설이 모순이라는 것은 한 가설이 참이면 다른 가설은 거짓이 된다는 것이므로 동시에 참이 되거나 동시에 거짓이 될 수 없다.</p><p>② 병이 호전된다는 것은 신약이 효과가 있다는 것이므로 ‘신약이 효과가 없다.’라는 귀무가설과 어긋난다.</p><p>③ 귀무가설을 버린다는 것은 ‘신약이 효과가 없다’라는 가설을 기각하는 것이다.</p><p>⑤ 판단에서 발생하는 두 가지 오류인 1종 오류와 2종 오류를 의미한다.</p>',149,19,16,'2022-08-22 15:38:03.0'),
	 ('<p>다음 글의 요지로 가장 적절한 것은?</p><p><img src="http://localhost:8080/bookie/images/question/7939e878-e3e5-4ecd-9374-1482bf109955_image.png" alt="문제이미지" contenteditable="false"><br></p>',3,'<p><img src="http://localhost:8080/bookie/images/comment/88305b4e-4e12-41d6-b712-b78b1e6445d2_image.png" alt="문제이미지" contenteditable="false"></p>',150,NULL,17,'2022-08-22 15:38:10.0'),
