	 ('<p>다음 글의 요지로 가장 적절한 것은?</p><p><img src="http://localhost:8080/bookie/images/question/3ff91f8a-57ec-4bbb-8c7c-463e6cecfe94_image.png" alt="문제이미지" contenteditable="false"><br></p>',1,'<p><img src="http://localhost:8080/bookie/images/comment/0d890972-40aa-41f0-a447-cb4ff2243d6d_image.png" alt="문제이미지" contenteditable="false"></p>',154,NULL,17,'2022-08-22 15:39:07.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/4ec681da-210d-4770-907b-6592b4349545_image.png" alt="문제이미지" contenteditable="false"><br></p>',5,'<p><img src="http://localhost:8080/bookie/images/comment/c0960f20-b52d-4ff7-83e3-1117c84a5cf8_image.png" alt="문제이미지" contenteditable="false"></p>',155,NULL,18,'2022-08-22 15:39:32.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/8092bb0b-f4be-414b-bcd2-ee5f3c1f6058_image.png" alt="문제이미지" contenteditable="false"><br></p>',3,'<p><img src="http://localhost:8080/bookie/images/comment/52dddf85-2098-4e58-89fd-f294bbac13e5_image.png" alt="문제이미지" contenteditable="false"></p><p><img src="http://localhost:8080/bookie/images/comment/b842fb49-8ff8-4d62-87f9-a90f6067e7f5_image.png" alt="문제이미지" contenteditable="false"></p>',156,NULL,18,'2022-08-22 15:39:46.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/4c034db3-b8b6-4915-b538-997aa9af4f47_image.png" alt="문제이미지" contenteditable="false"></p>',5,'<p>(사회) 최정규, 정보화가 가져 온 새로운 차원의 불확실성</p><p>이 글은 경제적인 측면에서 수확 체증의 법칙을 통해  산업 사회와 다른 정보 기술 사회의 특징을 설명한 글이다.</p><p>[출제의도] 글의 내용을 구체적 상황에 적용한다.</p><p>B사가 시장에서 부진했던 것은 네트워크 외부성으로 인해 A사가 이미 매우 유리한 위치를 선점하고 있기 때문이지 (가)와 같은 현상이 나타났기 때문이라고 보기는 어렵다.</p><p>[오답풀이] ① 수확 체감의 법칙이 나타나게 되면 기업은 이윤을 극대화할 수 있는 적절한 선에서 생산 규모를 설정한다고 하였다. ② 수확 체증의 법칙이 나타나면 기업은 시장 규모가 허락하는 선까지 생산 규모를 확대해 갈 것이라고 하였다. ③ A사의 제품은 많은 사람들이 오래 전부터 널리 사용해 왔으며, 싸고 좋은 B사의 제품이 시장에서 큰 성공을 거두지 못한 것으로 보아, A사의 제품에 네트워크 외부성이 나타났다고 볼 수 있다. ④ 문서 작성 프로그램 산업의 경우 초기 개발 비용이 많이 들며, A사의 제품에는 네트워크 외부성이 나타나고 있으므로 (나)와 같은 현상이 나타날 가능성이 높다.</p>',157,20,16,'2022-08-22 15:40:20.0');
INSERT INTO Question (qText,answer,qComment,qtId,mtId,cateId,regDate) VALUES
	 ('<p><img src="http://localhost:8080/bookie/images/question/0c3c2d8b-b4f5-4b82-9b3d-67bc22f49124_image.png" alt="문제이미지" contenteditable="false"></p>',3,'<p>(사회) 최정규, 정보화가 가져 온 새로운 차원의 불확실성</p><p>이 글은 경제적인 측면에서 수확 체증의 법칙을 통해  산업 사회와 다른 정보 기술 사회의 특징을 설명한 글이다.</p><p>[출제의도] 글의 내용을 사실적으로 파악한다.</p><p>정보 기술 사회를 대표하는 산업들은 초기 개발 비용이 많이 든다는 내용이 언급되어 있지만, 그 이유에 대해서는 설명되어 있지 않다.</p>',157,20,16,'2022-08-22 15:40:20.0'),
