	 ('<p><img src="http://localhost:8080/bookie/images/question/d3524d01-1e31-4a72-9b7c-dea2b802f12e_image.png" alt="문제이미지" contenteditable="false"><br></p>',1,'<p><img src="http://localhost:8080/bookie/images/comment/ff8d1ef1-e0b3-4c7a-9e1b-c79ac57d5b69_image.png" alt="문제이미지" contenteditable="false"></p><p><img src="http://localhost:8080/bookie/images/comment/9c1dd816-e4ef-4ed1-8e24-1677223f8d07_image.png" alt="문제이미지" contenteditable="false"></p><p><img src="http://localhost:8080/bookie/images/comment/4dbcd7cd-d781-4884-a79e-0bbedeb98389_image.png" alt="문제이미지" contenteditable="false"></p>',193,NULL,18,'2022-08-22 15:57:34.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/86b8326e-2044-4442-b54b-8729706c6286_image.png" alt="문제이미지" contenteditable="false"><br></p>',1,'<p><img src="http://localhost:8080/bookie/images/comment/aa6ea903-eb2a-4982-ba57-68cbf2acda4c_image.png" alt="문제이미지" contenteditable="false"></p>',194,NULL,18,'2022-08-22 15:57:59.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/8f69f969-2a8f-4faa-bc1f-b112de56222d_image.png" alt="문제이미지" contenteditable="false"></p>',1,'<p>[출제의도] 어휘의 의미 파악하기</p><p>㉠은 ''정하여 세우다''의 의미로 쓰였으므로 ''정립(定立)하다''와 바꾸어 쓸 수 있다.</p><p>''성립(成立)하다''는　''일이나 관계 따위가 제대로 이루어지다''의 뜻이며, ''설립(設立)하다''는 ''기관이나 조직체 따위를 만들어 일으키다''의 뜻이며, ''수립(樹立)하다''는 ''국가나 정부, 제도, 계획 따위를 이룩하여 세우다''의 뜻이며, ''건립(建立)하다''는 ''기관, 조직체 따위를 새로 조직하다''의 뜻이다.</p>',195,24,16,'2022-08-22 15:58:51.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/33b8e43a-d7cd-4bd8-af86-fcbd73802cf5_image.png" alt="문제이미지" contenteditable="false"></p>',3,'<p>[출제의도] 각 문단의 세부 정보 파악하기</p><p>ㄱ과 ㄴ은 1문단에서, ㄹ은 2문단과 4문단에서 각각 확인할 수 있다.</p>',195,24,16,'2022-08-22 15:58:51.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/cca71e3e-dde1-40c2-8646-89571152fb79_image.png" alt="문제이미지" contenteditable="false"></p>',4,'<p>[출제의도] 제시된 시각 자료와 연관지어 내용 이해의 적절성 판단하기</p><p>&lt;보기&gt;의 A는 이산화탄소의 임계 압력과 임계 온도에 해당하는 임계점을 나타낸 것으로, 이때 이산화탄소는 초임계유체 상태가 된다. 초임계유체 이산화탄소는 점도와 표면장력이 낮아져서 추출하려는 물질에 통과시키면 물질의 미세 구멍에 침투하여 원하는 성분을 추출할 수 있다. 그러나 온도와 압력을 A보다 낮추면 이산화탄소의 상태가 바뀌게 되어 기체나 액체 상태가 되기 때문에 점도와 표면장력이 낮아지지 않는다.</p>',195,24,16,'2022-08-22 15:58:52.0');
INSERT INTO Question (qText,answer,qComment,qtId,mtId,cateId,regDate) VALUES
	 ('<p><img src="http://localhost:8080/bookie/images/question/f86620a5-1be8-4333-99ca-62db17814368_image.png" alt="문제이미지" contenteditable="false"></p>',2,'<p>[출제의도] 추론의 적절성 판단하기</p><p>[A]를 통해 극성 물질은 극성 용매에 녹고, 무극성 물질은 무극성 용매에 녹는다는 것을 알 수 있다. 즉, 극성을 가진 소금이 극성인 물에만 녹는 것처럼 무극성인 카페인이나 기름은 극성이 없는 이산화탄소로 녹여내야 한다. 결국, 물질의 극성에 따라 물질을 추출하는 용매가 달라지는 것이다.</p>',195,24,16,'2022-08-22 15:58:52.0'),
