	 ('<p>㉠ ~ ㉢에 대한 설명으로 적절한 것은?</p><p>①	㉠은 가스 하이드레이트에서 메탄을 얻고자 가열된 기체를 이용한 방법이다.</p><p>②	㉡은 가스 하이드레이트 층에 압력을 가하여 메탄을 생산하는 방법이다.</p><p>③	㉢은 가스 하이드레이트의 구조적인 특성을 이용한 방법이다.</p><p>④	㉡은 ㉠과 달리 가스 하이드레이트 층에 직접 시추하는 방법이다.</p><p>⑤	㉠, ㉡은 ㉢과 달리 가스 하이드레이트 구조를 바꾸지 않는 방법이다.</p>',3,'<p><img src="http://localhost:8080/bookie/images/comment/023114a8-03cb-426e-b94d-6215bb64bafa_image.png" alt="문제이미지" contenteditable="false"></p><p>정보 간의 관련성 추론</p><p>{정답이 정답인 이유}</p><p>3문단을 볼 때, 가스 하이드레이트의 구조는 벌집 구조처럼 입체형이다. 이 안에 메탄 등과 같은 가스들이 화학 결합 없이 물리적으로갇혀 있는 상태이다. 따라서 이산화 탄소를 가스 하이드레이트에 밀어 넣으면 메탄 등이 다른 성분과 화학 결합을 하고 있지 않으므로 밀려 나오게 되는 것이다. 따라서 ㉢은 가스 하이드레이트의 구조적인 특성을 이용한 방법이라 할 수 있다.</p><p>{오답이 오답인 이유}</p><p>① 2문단을 볼 때, ㉠은 가열된 기체가 아니라 열수를 이용하는 방법이다.</p><p>② 2문단을 볼 때, ㉡은 가스 하이드레이트 층이 아닌, 그 층과 인접한 공극의 압력을 낮춰 메탄을 생산하는 방법이다.</p><p>④ 2문단을 볼 때, ㉡이 아니라 ㉠이 가스 하이드레이트 층에 직접 시추하는 방법이다.</p><p>⑤ 2문단을 볼 때, ㉠과 ㉡은 가스 하이드레이트를 녹여 메탄을 얻고, 3문단을 볼 때, ㉢은 가스 하이드레이트 내의 메탄을 이산화 탄소와 치환하여 메탄을 얻는 것이다. 따라서 ㉠과 ㉡은 가스 하이드레이트의 구조를 바꿔 메탄을 얻는 방법이라 할 수 있다.</p>',208,27,16,'2022-08-22 16:26:02.0'),
	 ('<p><img src="http://localhost:8080/bookie/images/question/8887b4f3-315a-451a-a44c-164d672a05cb_image.png" alt="문제이미지" contenteditable="false"><br></p>',5,'<p><img src="http://localhost:8080/bookie/images/comment/324073a8-a292-4b53-a249-29fa99500191_image.png" alt="문제이미지" contenteditable="false"></p>',209,NULL,16,'2022-08-22 16:28:56.0'),
